DIAttribute.value:
$BlockCount =  null;
$Quotient= 0;
$Remainder = 0;

if($TotalRows is not null and $TotalRows <> 0)
begin
	if($TotalRows < 10)
	begin
		$BlockCount = '1' ;
	end
	else 
	begin
		$Quotient = $TotalRows * 0.1;
		$Remainder = mod($TotalRows ,10);
		$BlockCount = cast( ifthenelse($Remainder > 0 ,$Quotient + 1 , $Quotient ) , 'varchar(48)'); 	
	end
end

Return $BlockCount;

